var AutoClosingProcessor = class {
  constructor() {
    this.regex = /<(\s*?([\w]*)[^>]*?)\/(?<=\/)>/gm;
  }
  process(markdown) {
    return this.transformBlock(markdown);
  }
  transformBlock(markdown) {
    markdown = markdown.replaceAll(this.regex, `<$1></$2>`);
    return markdown;
  }
};

