// src/obsidian/processors/calloutProcessor.ts
var CalloutProcessor = class {
  constructor() {
    this.regex = />\s\[!([^\]]+)\]-* *(.*)/;
  }
  process(markdown) {
    const lineArray = markdown.split("\n");
    const outArray = [];
    let startIdx = -1;
    let add = true;
    for (let i = 0; i < lineArray.length; i++) {
      const line = lineArray[i];
      if (line.trim().startsWith(">") && startIdx == -1) {
        startIdx = i;
        add = false;
      } else if (!line.trim().startsWith(">") && startIdx > -1) {
        const content = this.transformBlock(lineArray, startIdx, i - 1);
        for (let index = 0; index < content.length; index++) {
          const contentLine = content[index];
          outArray.push(contentLine);
        }
        startIdx = -1;
        add = true;
      }
      if (add) {
        outArray.push(lineArray[i]);
      }
    }
    return outArray.join("\n");
  }
  transformBlock(lines, start, end) {
    const result = [];
    if (this.regex.test(lines[start])) {
      const [, type2, titleLine] = this.regex.exec(lines[start]);
      const icon = this.iconFrom(type2);
      const title = this.titleFrom(type2, titleLine);
      const color = this.colorFrom(type2);
      result.push(`<div class="callout ${color}">`);
      result.push('<div class="callout-title">');
      result.push('<div class="callout-icon">');
      result.push("");
      result.push(icon);
      result.push("");
      result.push("</div>");
      result.push('<div class="callout-title-inner">');
      result.push("");
      result.push(title);
      result.push("");
      result.push("</div>");
      result.push("</div>");
      result.push('<div class="callout-content">');
      for (let i = start + 1; i <= end; i++) {
        result.push("");
        const line = lines[i].trim().substring(1).trim();
        result.push(line);
      }
      result.push("");
      result.push("</div>");
      result.push("</div>");
    } else {
      for (let i = start; i <= end; i++) {
        const line = lines[i];
        result.push(line);
      }
    }
    return result;
  }
  colorFrom(type2) {
    const input = type2.toLowerCase();
    switch (input) {
      case "abstract":
      case "summary":
      case "tldr":
      case "info":
        return "callout-color1";
      case "todo":
      case "tip":
      case "hint":
      case "important":
        return "callout-color2";
      case "success":
      case "check":
      case "done":
        return "callout-color3";
      case "question":
      case "help":
      case "faq":
        return "callout-color4";
      case "warning":
      case "caution":
      case "attention":
        return "callout-color5";
      case "failure":
      case "fail":
      case "missing":
        return "callout-color6";
      case "danger":
      case "error":
      case "bug":
        return "callout-color7";
      case "example":
        return "callout-color8";
      case "quote":
      case "cite":
        return "callout-color9";
      default:
        return "callout-color-default";
    }
  }
  titleFrom(icon, titleLine) {
    if (titleLine) {
      return titleLine;
    } else {
      return icon[0].toUpperCase() + icon.substring(1).toLowerCase();
    }
  }
  iconFrom(type2) {
    const input = type2.toLowerCase();
    switch (input) {
      case "abstract":
      case "summary":
      case "tldr":
        return ":fas_clipboard-list:";
      case "info":
        return ":fas_info-circle:";
      case "todo":
        return ":fas_check-circle:";
      case "tip":
      case "hint":
      case "important":
        return ":fas_fire-alt:";
      case "success":
      case "check":
      case "done":
        return ":fas_check:";
      case "question":
      case "help":
      case "faq":
        return ":fas_question-circle:";
      case "warning":
      case "caution":
      case "attention":
        return ":fas_exclamation-triangle:";
      case "failure":
      case "fail":
      case "missing":
        return ":fas_times:";
      case "danger":
      case "error":
        return ":fas_bolt:";
      case "bug":
        return ":fas_bug:";
      case "example":
        return ":fas_list:";
      case "quote":
      case "cite":
        return ":fas_quote-left:";
      default:
        return ":fas_pencil-alt:";
    }
  }
};

// src/obsidian/processors/templateProcessor.ts
var TemplateProcessor = class {
  constructor(utils) {
    this.emptySlideCommentRegex = /<!--\s*(?:\.)?slide(?::)?\s*-->/g;
    this.templateCommentRegex = /<!--\s*(?:\.)?slide.*(template="\[\[([^\]]+)\]\]"\s*).*-->/;
    this.propertyRegex = /:::\s([^\n]+)\s*(.*?:::[^\n]*)/gs;
    this.slideCommentRegex = /<!--\s*(?:\.)?slide.*-->/;
    this.optionalRegex = /<%\?.*%>/g;
    this.parser = new CommentParser();
    this.utils = utils;
    this.multipleFileProcessor = new MultipleFileProcessor(utils);
    this.footnoteProcessor = new FootnoteProcessor();
  }
  process(markdown, options) {
    let input = markdown;
    if (options.defaultTemplate != null) {
      markdown.split(new RegExp(options.separator, "gmi")).map((slidegroup) => {
        return slidegroup.split(new RegExp(options.verticalSeparator, "gmi")).map((slide) => {
          if (this.slideCommentRegex.test(slide)) {
            const [slideAnnotation] = this.slideCommentRegex.exec(slide);
            const comment = this.parser.parseLine(slideAnnotation);
            if (!comment.hasAttribute("template")) {
              comment.addAttribute(
                "template",
                options.defaultTemplate,
                false
              );
            }
            input = input.split(slide).join(
              slide.split(slideAnnotation).join(
                this.parser.commentToString(
                  comment
                )
              )
            );
          } else {
            input = input.split(slide).join(
              `<!-- slide template="${options.defaultTemplate}" -->
` + slide
            );
          }
          return slide;
        }).join(options.verticalSeparator);
      }).join(options.separator);
    }
    let output = input;
    input.split(new RegExp(options.separator, "gmi")).map((slidegroup) => {
      return slidegroup.split(new RegExp(options.verticalSeparator, "gmi")).map((slide) => {
        if (this.templateCommentRegex.test(slide)) {
          try {
            let [md2, notes] = this.extractNotes(
              slide,
              options
            );
            let circuitCounter = 0;
            while (this.templateCommentRegex.test(md2)) {
              circuitCounter++;
              md2 = this.transformSlide(md2);
              if (circuitCounter > 9) {
                console.log(
                  "WARNING: Circuit in template hierarchy detected!"
                );
                break;
              }
            }
            md2 = md2.replaceAll(
              this.emptySlideCommentRegex,
              ""
            );
            md2 = md2.trim();
            md2 = this.computeVariables(md2);
            if (notes.length > 0) {
              md2 += "\n\n" + notes;
            }
            output = output.split(slide).join(md2);
            return md2;
          } catch (error) {
            console.log(
              "Cannot process template: " + error
            );
            return slide;
          }
        }
        return slide;
      }).join(options.verticalSeparator);
    }).join(options.separator);
    return output;
  }
  extractNotes(input, options) {
    let noteSeparator = "note:";
    if (options.notesSeparator && options.notesSeparator.length > 0) {
      noteSeparator = options.notesSeparator;
    }
    const spliceIdx = input.indexOf(noteSeparator);
    if (spliceIdx > 0) {
      return [input.substring(0, spliceIdx), input.substring(spliceIdx)];
    } else {
      return [input, ""];
    }
  }
  transformSlide(slide) {
    if (this.templateCommentRegex.test(slide)) {
      const [, templateProperty, file] = this.templateCommentRegex.exec(slide);
      let fileWithExtension = file;
      if (!fileWithExtension.endsWith(".md")) {
        fileWithExtension = fileWithExtension + ".md";
      }
      let templateContent = this.utils.parseFile(fileWithExtension, null);
      templateContent = this.multipleFileProcessor.process(templateContent);
      templateContent = templateContent.split("<% content %>").join(slide.replaceAll(templateProperty, ""));
      return templateContent;
    } else {
      return slide;
    }
  }
  computeVariables(slide) {
    let result = slide;
    this.propertyRegex.lastIndex = 0;
    let m;
    while ((m = this.propertyRegex.exec(slide)) !== null) {
      if (m.index === this.propertyRegex.lastIndex) {
        this.propertyRegex.lastIndex++;
      }
      let [match2, name, content] = m;
      if (name.includes("<!--")) {
        name = name.substring(0, name.indexOf("<!--"));
      }
      if (name.trim() == "block")
        continue;
      content = "::: block\n" + content;
      const optionalName = "<%? " + name.trim() + " %>";
      name = "<% " + name.trim() + " %>";
      result = result.replaceAll(
        optionalName,
        content + "\n" + optionalName
      );
      result = result.replaceAll(name, content);
      result = result.replaceAll(match2, "");
    }
    result = this.footnoteProcessor.transformFootNotes(result);
    while ((m = this.optionalRegex.exec(result)) !== null) {
      if (m.index === this.optionalRegex.lastIndex) {
        this.optionalRegex.lastIndex++;
      }
      result = result.replaceAll(m[0], "");
    }
    return result;
  }
};

// src/obsidian/processors/chartProcessor.ts
var ChartProcessor = class {
  constructor() {
    this.typeRegex = /type:\s(\w*)/;
    this.labelRegex = /labels:\s(.*)/;
    this.datasetRegex = /title:\s(.*)\s*data:\s(.*)/g;
    this.spanGapsRegex = /(spanGaps):\s(.*)/;
    this.tensionRegex = /(tension):\s(.*)/;
    this.beginAtZeroRegex = /(beginAtZero):\s(.*)/;
    this.legendRegex = /(legend):\s(.*)/;
    this.legendPositionRegex = /(legendPosition):\s(.*)/;
    this.stackedRegex = /(stacked):\s(.*)/;
    this.heightRegex = /(height):\s(.*)/;
    this.useThemeColorsRegex = /(useThemeColors):\s(.*)/;
    this.colorMap = [
      "#4285f4",
      "#ea4335",
      "#fbbc05",
      "#34a853",
      "#673ab7",
      "#cccccc",
      "#777777"
    ];
  }
  process(markdown, options) {
    return this.transformChart(markdown, options);
  }
  transformChart(markdown, options) {
    const startIdx = markdown.indexOf("```chart");
    if (startIdx < 0) {
      return markdown;
    } else {
      const endIdx = markdown.indexOf("```", startIdx + 11);
      if (endIdx < 0) {
        return markdown;
      }
      const colorMap = [...this.colorMap];
      const before = markdown.substring(0, startIdx);
      const after = markdown.substring(endIdx + 3);
      const chartMarkup = markdown.substring(startIdx + 8, endIdx);
      if (this.typeRegex.test(chartMarkup)) {
        const [, type2] = this.typeRegex.exec(chartMarkup);
        const chart = {
          data: {
            datasets: [],
            labels: []
          },
          options: { elements: {} }
        };
        if (this.useThemeColorsRegex.test(chartMarkup)) {
          const [, , value] = this.useThemeColorsRegex.exec(chartMarkup);
          if (value.trim() == "true") {
            for (let i = 0; i < 7; i++) {
              const style = getComputedStyle(
                document.body
              ).getPropertyValue("--chart-color-" + (i + 1));
              if (style != "") {
                colorMap[i] = style;
              }
            }
          }
        }
        if (this.labelRegex.test(chartMarkup)) {
          const [, labels] = this.labelRegex.exec(chartMarkup);
          chart.data.labels = parseLabels(labels);
          this.datasetRegex.lastIndex = 0;
          let i = 0;
          let m;
          while ((m = this.datasetRegex.exec(chartMarkup)) !== null) {
            if (m.index === this.datasetRegex.lastIndex) {
              this.datasetRegex.lastIndex++;
            }
            const [, title, data] = m;
            chart.data.datasets.push({
              data: JSON.parse(data),
              label: title,
              backgroundColor: colorMap[i]
            });
            i++;
          }
          chart.options.elements[type2] = {};
          if (this.spanGapsRegex.test(chartMarkup)) {
            const [, key, value] = this.spanGapsRegex.exec(chartMarkup);
            chart.options.elements[type2][key] = JSON.parse(value);
          }
          if (this.tensionRegex.test(chartMarkup)) {
            const [, key, value] = this.tensionRegex.exec(chartMarkup);
            chart.options.elements[type2][key] = JSON.parse(value);
          }
          if (this.beginAtZeroRegex.test(chartMarkup)) {
            const [, key, value] = this.beginAtZeroRegex.exec(chartMarkup);
            if (!chart.options.scales) {
              chart.options.scales = {};
            }
            if (!chart.options.scales.y) {
              chart.options.scales.y = {};
            }
            chart.options.scales.y[key] = JSON.parse(value);
          }
          if (this.legendRegex.test(chartMarkup)) {
            const [, , value] = this.legendRegex.exec(chartMarkup);
            if (!chart.options.plugins) {
              chart.options.plugins = {};
            }
            if (!chart.options.plugins.legend) {
              chart.options.plugins.legend = {};
            }
            chart.options.plugins.legend.display = JSON.parse(value);
          }
          if (this.legendPositionRegex.test(chartMarkup)) {
            const [, , value] = this.legendPositionRegex.exec(chartMarkup);
            if (!chart.options.plugins) {
              chart.options.plugins = {};
            }
            if (!chart.options.plugins.legend) {
              chart.options.plugins.legend = {};
            }
            chart.options.plugins.legend.position = value;
          }
          if (this.stackedRegex.test(chartMarkup)) {
            const [, key, value] = this.stackedRegex.exec(chartMarkup);
            if (!chart.options.scales) {
              chart.options.scales = {};
            }
            if (!chart.options.scales.y) {
              chart.options.scales.y = {};
            }
            if (!chart.options.scales.x) {
              chart.options.scales.x = {};
            }
            chart.options.scales.x[key] = JSON.parse(value);
            chart.options.scales.y[key] = JSON.parse(value);
          }
          if (this.heightRegex.test(chartMarkup)) {
            const [, , value] = this.heightRegex.exec(chartMarkup);
            options.height = +value;
          }
          const canvas = `<canvas style="max-height:${options.height}px" data-chart="${type2}" >
<!--
${JSON.stringify(chart)}-->
</canvas>`;
          const result = before.trimEnd() + "\n" + canvas + "\n" + after.trimStart();
          return this.transformChart(result, options);
        }
      }
      return markdown;
    }
  }
};
function parseLabels(labels) {
  return labels.substring(1, labels.length - 1).split(",").map((label) => {
    let value = label.trim();
    if (value.startsWith("'") || value.startsWith('"')) {
      value = value.substring(1);
    }
    if (value.endsWith("'") || value.endsWith('"')) {
      value = value.substring(0, value.length - 1);
    }
    return `${value.trim()}`;
  });
}

// src/obsidian/processors/defaultBackgroundProcessor.ts
var DefaultBackgroundProcessor = class {
  constructor() {
    this.slideCommentRegex = /<!--\s*(?:\.)?slide.*-->/;
    this.parser = new CommentParser();
  }
  process(markdown, options) {
    let output = markdown;
    if (options?.bg) {
      if (options?.bg == "transparent" || options?.bg == "rgba(0,0,0,0)") {
        output = `<style>
body {
	background-color: rgba(0,0,0,0) !important;
}
</style>
` + output;
      }
      markdown.split(new RegExp(options.separator, "gmi")).map((slidegroup) => {
        return slidegroup.split(new RegExp(options.verticalSeparator, "gmi")).map((slide) => {
          if (slide) {
            const newSlide = this.transformSlide(
              slide,
              options?.bg
            );
            output = output.split(slide).join(newSlide);
            return newSlide;
          } else {
            return slide;
          }
        }).join(options.verticalSeparator);
      }).join(options.separator);
    }
    return output;
  }
  transformSlide(slide, bg) {
    if (this.slideCommentRegex.test(slide)) {
      const [match2] = this.slideCommentRegex.exec(slide);
      const comment = this.parser.parseLine(match2);
      if (!comment.hasAttribute("data-background-image") && !comment.hasAttribute("data-background-color")) {
        comment.addAttribute("bg", bg);
      }
      return slide.replace(
        this.slideCommentRegex,
        this.parser.commentToString(comment)
      );
    } else {
      return slide + `
<!-- slide bg="${bg}" -->
`;
    }
  }
};

